// src/pages/BehavioralQuestionPage.js
import React, { useEffect, useState } from 'react';
import axios from 'axios';

const BehavioralQuestionPage = () => {
  const [questions, setQuestions] = useState([]);

  useEffect(() => {
    fetchQuestions();
  }, []);

  const fetchQuestions = async () => {
    try {
      const response = await axios.get('/api/behavioral-questions');
      setQuestions(response.data);
    } catch (error) {
      console.error('Error fetching questions:', error);
    }
  };

  return (
    <div>
      <h1 className="text-4xl font-bold mb-4">Behavioral Questions</h1>
      {questions.map(question => (
        <div key={question._id} className="mb-4">
          <h2 className="text-2xl font-bold">{question.resourceTitle}</h2>
          <p>{question.resourceContent}</p>
          <a href={question.resourceUrl} className="text-blue-500 hover:underline">Practice Questions</a>
        </div>
      ))}
    </div>
  );
};

export default BehavioralQuestionPage;
